async function clickDom(dom) {
    if (typeof dom === 'string') {
        dom = document.querySelector(dom);

    } if (dom) {
        dom.click();
        await new Promise(resolve => setTimeout(resolve, 150));

    }
};


async function eventDispatch(dom, event = 'input', value = null, time = 1) {
    if (typeof dom === 'string') {
        dom = document.querySelector(dom);
    }
    if (dom) {
        if (event === 'input') {
            dom.value = value;
        }
        dom.dispatchEvent(new Event(event));
        await new Promise(resolve => setTimeout(resolve, 50 * time));

    }

};

async function eventDispatchNextEleINput(ele, value, time) {
    await eventDispatch(ele.nextElementSibling.querySelector('input'), 'input', value, time)
}

