window.addEventListener('load', async function () {

    // 创建一个全局对象来存储事件监听器
    const eventListeners = new WeakMap();

    // 保存原始的 addEventListener 方法
    const originalAddEventListener = EventTarget.prototype.addEventListener;

    // 覆盖 addEventListener 方法
    EventTarget.prototype.addEventListener = function (type, listener, options) {
        if (!eventListeners.has(this)) {
            eventListeners.set(this, {});
        }
        const listeners = eventListeners.get(this);
        if (!listeners[type]) {
            listeners[type] = [];
        }
        listeners[type].push(listener);
        originalAddEventListener.call(this, type, listener, options);
    };

    // 检查某个元素是否有指定的事件监听器
    EventTarget.prototype.hasEventListener = function (type) {
        if (!eventListeners.has(this)) {
            return false;
        }
        const listeners = eventListeners.get(this);
        return listeners[type] && listeners[type].length > 0;
    };

    let packageEles;
    setInterval(() => {
        packageEles = document.querySelectorAll("td:nth-child(2) > div > div:nth-child(1) > div > span");
        if (packageEles.length == 0) {
            // console.log('没有包裹~');
            return;
        }
        packageEles.forEach(packageEle => {

            if (packageEle.hasEventListener('click')) {
                return;
            }
            packageEle.addEventListener('click', function () {
                let packageSn = packageEle.nextElementSibling.querySelector('span span').innerText
                updateFbmPackageAddressToUs(packageSn);
                showToast(`${packageSn}：美国地址修改成功`);
            })
        })

    }, 1000);


}, false);

